IPAD-406.description:
Crash dumps now include a build id in the header:

{code}
Identifier:      Shareable-Ink.Shareable-Ink
Version:         1.0
Build Id:        buildtest_qa_128
Code Type:       ARM
Parent Process:  launchd [1]
{code}

This build id is also used to name the builds in Confluence. There are corresponding builds:

{code}
buildtest_qa_128.ipa
buildtest_qa_128.dSYM.tar
{code}

This build id is also used to tag the source code:

{code}
$ git tag -l -n1 buildtest_qa_128
buildtest_qa_128 Tagged by build system on Tue Apr 23 16:23:03 CDT 2013
{code}

So now given a crash dump, it is easy to grab the corresponding dSYM and source code information for debugging.

